#!/bin/bash SCRIPT_START_TIME="$( date +%s )" && export SCRIPT_START_TIME && echo "########## STARTING STAGE: PUSH THE IMAGE-INSPECTOR IMAGES ##########" && trap 'export status=FAILURE' ERR && trap 'set +o xtrace; SCRIPT_END_TIME="$( date +%s )"; ELAPSED_TIME="$(( SCRIPT_END_TIME - SCRIPT_START_TIME ))"; echo "########## FINISHED STAGE: ${status:-SUCCESS}: PUSH THE IMAGE-INSPECTOR IMAGES [$( printf "%02dh %02dm %02ds" "$(( ELAPSED_TIME/3600 ))" "$(( (ELAPSED_TIME%3600)/60 ))" "$(( ELAPSED_TIME%60 ))" )] ##########"' EXIT && set -o errexit -o nounset -o pipefail -o xtrace && if [[ -s "${WORKSPACE}/activate" ]]; then source "${WORKSPACE}/activate"; fi script="$( mktemp )" cat <<SCRIPT >"${script}" #!/bin/bash set -o errexit -o nounset -o pipefail -o xtrace cd "\${GOPATH}/src/github.com/openshift/image-inspector" sudo chmod a+rw /tmp/.docker/config.json export DOCKER_CONFIG=/tmp/.docker
docker tag openshift/image-inspector:2.4.0 docker.io/openshift/image-inspector:2.4.0 docker push docker.io/openshift/image-inspector:2.4.0
docker tag openshift/image-inspector:2.4.0 docker.io/openshift/image-inspector:2.4 docker push docker.io/openshift/image-inspector:2.4 SCRIPT chmod +x "${script}" scp -F ${WORKSPACE}/.config/origin-ci-tool/inventory/.ssh_config "${script}" openshiftdevel:"${script}" ssh -F ${WORKSPACE}/.config/origin-ci-tool/inventory/.ssh_config -t openshiftdevel "bash -l -c \"timeout 7200 ${script}\""

